```javascript
describe('Integration Test Suite', () => {
  before(() => {
    // Start the service inside the Docker container
    cy.exec('docker-compose up --build');
  });

  beforeEach(() => {
    // Wait for the service to start
    cy.wait(3000);
  });

  after(() => {
    // Stop the service when done
    cy.exec('docker-compose down');
  });

  context('When navigating to the homepage', () => {
