        // Save the screenshot to the local filesystem
        const imagePath = `${__dirname}/screenshots/page-not-found.png`;
        fs.writeFileSync(imagePath, screenshotData);

        // Optionally, assert the existence of the file
        cy.readFile(imagePath).should('exist');
      });
    });
  });
