        BigDecimal logBase3 = new BigDecimal(Math.log(n) / Math.log(3));
        BigDecimal roundedLogBase3 = logBase3.setScale(0, RoundingMode.HALF_UP);

        // Check if the rounded value is an integer
        return roundedLogBase3.equals(logBase3);
    }

