#include <iostream>
#include <fstream>
#include <string>
#include <map>

// Function to count the occurrences of a word in a given string
int countWordOccurrences(const std::string& line, const std::string& word) {
    int count = 0;
    size_t pos = 0;

    // Use find function to locate the word in the line
    while ((pos = line.find(word, pos)) != std::string::npos) {
        count++;
        pos += word.length(); // Move past one character to skip duplicates
    }

    return count;
}

int main(int argc, char* argv[]) {
    if (argc != 3) {
        std::cerr << "Usage: " << argv[0] << " <input_file> <word_to_search>" << std::endl;
        return 1;
    }

    std::string inputFile = argv[1];
    std::string searchWord = argv[2];

    std::ifstream file(inputFile);
    if (!file.is_open()) {
        std::cerr << "Unable to open file: " << inputFile << std::endl;
        return 1;
    }

    std::map<std::string, int> wordCount; // To keep track of word counts per line

    std::string line;
    while (std::getline(file, line)) {
        ++wordCount[line]; // Increment count for each line
        int count = countWordOccurrences(line, searchWord); // Count occurrences in this line
        wordCount[line] += count; // Add occurrence count from current line to total count for line
    }

    file.close();

    // Output the total occurrences for the specified word
    for (const auto& pair : wordCount) {
        std::cout << "Word '" << searchWord << "' occurs " << pair.second << " times in the line '" << pair.first << "'." << std::endl;
    }

    return 0;
}
```

